import { REQUEST_API_COIN, SET_EMAIL, SET_CURRENCIES } from './actionTypes';



export function saveEmail(email) {
  return {
    type: SET_EMAIL,
    email,
  };
}

export function setCurrencies(coins) {
  return {
    type: SET_CURRENCIES,
    coins,
  };
}
